pragma solidity ^0.8.0;

import 'ds-thing/thing.sol';

contract DSValue is DSThing {
    bool    has;
    bytes32 val;
    uint public wut;

    function peek() public view returns (uint, bool) {
        return (wut, has);
    }

    function read() public view returns (uint) {
        (uint wutLocal, bool hasLocal) = peek();
        require(hasLocal, "DSValue: hasLocal is false");
        return wutLocal;
    }
    function poke(bytes32 wut) public payable note auth {
        val = wut;
        has = true;
    }
    function void() public payable note auth {  // unset the value
        has = false;
    }
}

